SELECT
COUNT(1) as effective
FROM `zt_bug` t1 
where  t1.OPENEDBUILD = (select t.build from zt_testtask t  where t.id = ?)  and t1.openedDate > (select tt.`begin` from  zt_testtask tt  where tt.id = ?
) and t1.openedDate < (select CONCAT( DATE_FORMAT( tt.`end`, '%Y-%m-%d'),' 23:59:59') from  zt_testtask tt  where tt.id = ?
) and t1.`status` in ('resolved','closed') and t1.resolution in ('fixed','postponed')

SELECT
COUNT(1) as resolvedcnt
FROM `zt_bug` t1 
where  t1.OPENEDBUILD = (select t.build from zt_testtask t where t.id = ?)   and t1.openedDate > (select tt.`begin` from  zt_testtask tt  where tt.id = ?
) and t1.openedDate < (select CONCAT( DATE_FORMAT( tt.`end`, '%Y-%m-%d'),' 23:59:59') from  zt_testtask tt  where tt.id = ?
)  and t1.`status` in ('resolved','closed')

